webpackJsonp([0x5b7daa104d90],{411:function(e,a){e.exports={data:{site:{siteMetadata:{title:"MAC0213 Blog",author:"Victor Hugo M. Pinto"}},markdownRemark:{id:"/Users/victorhugo/Projects/mac213-blog/src/pages/16-06/index.md absPath of file >>> MarkdownRemark",html:'<p>Durante a semana dos dias 16/06 à 22/06, criei um repositório privado no GitLab chamado <code class="language-text">fatima-test</code> na minha conta pessoal para hospedar o código-fonte da aplicação já dockerizado e escrevi o arquivo <code class="language-text">.gitlab-ci.yml</code> que configura os diferentes passos do continuous integration a serem executados.</p>\n<p>Configurei os passos de <em>build</em> e <em>stage</em>, que são executados por Runners que executam comandos de Docker e preparam a aplicação para ser lançada.</p>\n<p>Infelizmente não consegui implementar o passo final no GitLab CI/CD que seria o deploy da aplicação, pois isso só pode ser feito no repositório oficial da FATIMA e terá que ser implementado pelo time da SMIT.</p>\n<p><strong>Horas</strong>: 5 horas</p>',frontmatter:{title:"Teste de configuração (GitLab CI/CD)",date:"June 23, 2019"}}},pathContext:{slug:"/16-06/",previous:{fields:{slug:"/09-06/"},frontmatter:{title:"Conteinerização (Pt. 8)"}},next:null}}}});
